import './App.css';
import {useState} from "react";

function App() {
  const [isVisible, setIsvisible] = useState(false);

  return (
    <div className="App">
      <button onClick={()=> setIsvisible(!isVisible)}>
      {isVisible ? "Hide" : "Show"}
      </button>
      {isVisible && <h1>Hidden text</h1>}
    </div>
  );
}

export default App;
